<ul>
<li>冲突域：也称碰撞域，如果两台主机同时发送数据，会导致冲突从而导致数据传输失败，则称这两台主机处于同一个冲突域中。处于同一冲突域的主机发送数据之前都需要进行“信道争用”</li>
</ul>
